import React from 'react';
import StepZilla from "react-stepzilla";
import './steps.css';
import CreateListing from './CreateListing'
import MediaUploads from './MediaUploads'
import SetRights from './SetRights'
const steps =
    [
      {name: 'Create List', component: <CreateListing />},
      {name: 'Media Uploads', component: <MediaUploads />},
      {name: 'Rights', component: <SetRights />},
    ]
class Bidding extends React.Component
{
  render()
  {
    return(
      <section class="dashb_cont">
        <div class="container">
            <div class="content_dash bidding_dash">
            <StepZilla steps={steps} stepsNavigation={true} prevBtn={false} startAtStep={0}/>
            </div>
            <div class="clearfix"></div>
        </div>
        <div class="clearfix"></div>
    </section>)
  }
}
export default Bidding;
